"    <div id=\"topicTitle\">",
"     Patient information: Pneumonia in children (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/pneumonia-in-children-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H11397153\">",
"      <span class=\"h1\">",
"       What is pneumonia?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Pneumonia is an infection of the lungs that causes coughing, fever, and trouble breathing. It is a serious illness, especially in young children. Pneumonia can be caused by bacteria or viruses. The most likely cause of pneumonia depends on the child&rsquo;s age:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        In children older than 5 years, pneumonia is more likely to be caused by bacteria.",
"       </li>",
"       <li>",
"        In babies and children younger than 5 years, pneumonia is more likely to be caused by a virus.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H11397168\">",
"      <span class=\"h1\">",
"       What are the symptoms of pneumonia?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Common symptoms include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Cough",
"       </li>",
"       <li>",
"        Fever",
"       </li>",
"       <li>",
"        Breathing faster than normal",
"       </li>",
"       <li>",
"        Trouble breathing or pain when breathing in",
"       </li>",
"       <li>",
"        Restlessness or trouble feeding (in babies)",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Not all children with pneumonia have the same symptoms. But if your child seems sick and has both a cough and a fever, he or she might have pneumonia.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H11397183\">",
"      <span class=\"h1\">",
"       Should my child see a doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. If you think your child might have pneumonia, see a doctor or nurse right away. Pneumonia can be very serious in children, especially if it is not treated right away.",
"     </p>",
"     <p>",
"      <strong>",
"       Call 9-1-1",
"      </strong>",
"      for an ambulance if your child:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Stops breathing",
"       </li>",
"       <li>",
"        Starts to turn blue or very pale",
"       </li>",
"       <li>",
"        Has a very hard time breathing (",
"        <a class=\"graphic graphic_figure graphicRef59786 \" href=\"UTD.htm?26/31/27121\">",
"         figure 1",
"        </a>",
"        )",
"       </li>",
"       <li>",
"        Starts grunting",
"       </li>",
"       <li>",
"        Looks like he or she is getting tired of having to work so hard to breathe",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      If a doctor or nurse thinks your child might have pneumonia, he or she will do an exam and listen to your child&rsquo;s breathing. He or she might also take an X-ray of your child&rsquo;s chest.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H11397198\">",
"      <span class=\"h1\">",
"       How is pneumonia treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Treatment depends on the child&rsquo;s age, how serious the pneumonia is, and whether it is caused by bacteria or a virus. Some children who are very sick, especially young children or babies, might need to be treated in the hospital.",
"     </p>",
"     <p>",
"      Pneumonia that is caused by bacteria is treated with antibiotics. Antibiotics are medicines that kill bacteria. They are available in pill or liquid form. Make sure that your child takes all of his or her antibiotics, even if he or she starts feeling better before finishing them!",
"     </p>",
"     <p>",
"      Antibiotics do",
"      <strong>",
"       not",
"      </strong>",
"      help with pneumonia that is caused by a virus. But your child&rsquo;s doctor or nurse might try other medicines if he or she thinks they will help.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H11397215\">",
"      <span class=\"h1\">",
"       How soon will my child feel better?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Most",
"      <strong>",
"      </strong>",
"      children who are treated with antibiotics start to feel better 2 to 3 days after they start taking the medicine. Even so, your child might still feel tired or have a cough for a few weeks or even months after being treated. It might also be a few months before he or she can breathe comfortably while exercising.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H11397230\">",
"      <span class=\"h1\">",
"       How should I take care of my child at home?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Try to keep your child as comfortable as possible, and make sure that he or she gets lots of rest. You should also give your child plenty of fluids to drink. For babies and very young children, it might help to offer small amounts of fluids frequently (instead of large amounts less often).",
"     </p>",
"     <p>",
"      Medicines such as",
"      <a class=\"drug drug_patient\" href=\"UTD.htm?19/35/20021?source=see_link\">",
"       acetaminophen",
"      </a>",
"      &nbsp;(sample brand name: Tylenol&reg;) or",
"      <a class=\"drug drug_patient\" href=\"UTD.htm?14/17/14614?source=see_link\">",
"       ibuprofen",
"      </a>",
"      &nbsp;(sample brand names: Advil&reg;, Motrin&reg;) can help relieve pain and fever. The correct dose depends on your child&rsquo;s weight, so ask your child&rsquo;s doctor how much to give.",
"     </p>",
"     <p>",
"      Do",
"      <strong>",
"       not",
"      </strong>",
"      give your child medicines that quiet a cough. These medicines don&rsquo;t usually work well, and they can have serious side effects in children. Also, do not give",
"      <a class=\"drug drug_patient\" href=\"UTD.htm?6/12/6342?source=see_link\">",
"       aspirin",
"      </a>",
"      or medicines that contain aspirin to children younger than 18 years. In children, aspirin can cause a serious problem called Reye syndrome.",
"     </p>",
"     <p>",
"      Call your child&rsquo;s doctor or nurse if your child does not seem to be getting better after 2 days. Your child might need a different type of treatment.",
"      <br/>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H11397247\">",
"      <span class=\"h1\">",
"       What can I do to keep my child from getting pneumonia again?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Wash your child&rsquo;s hands often with soap and water. It is one of the best ways to prevent the spread of infection. You can use an alcohol rub instead, but make sure the hand rub gets everywhere on your child&rsquo;s hands.",
"     </p>",
"     <p>",
"      There are several vaccines that help to protect against pneumonia. Talk to your child&rsquo;s doctor or nurse about which vaccines your child should get, and when he or she should get them.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H11397262\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
