"     Reproduced with permission from: Jarvis JG, Moroz PJ. Fractures and Dislocations of the Foot. In: Rockwood and Wilkins' Fractures in Children, 6th ed, Beaty JH, Kasser JR (Eds), Lippincott Williams &amp; Wilkins, Philadelphia 2006. Copyright &copy; 2006 Lippincott Williams &amp; Wilkins.",
