"  </div>",
"  <div id=\"drugTitle\">",
"   Ibuprofen: Patient drug information",
"  </div>",
"  <div id=\"lexiTitleImg\">",
"   <img height=\"17\" src=\"./../images/lexiComp/Lexicomp_2012_71x17.myextg\" width=\"71\"/>",
"  </div>",
"  <div class=\"clear\">",
"  </div>",
"  <div id=\"drugCopy\">",
"   Copyright 1978-2013 Lexicomp, Inc. All rights reserved.",
"  </div>",
"  <div id=\"topicText\">",
"   <p>",
"    (For additional information",
"    <a class=\"drug drug_general\" href=\"UTD.htm?15/38/15978?source=see_link\">",
"     see \"Ibuprofen: Drug information\"",
"    </a>",
"    and",
"    <a class=\"drug drug_pediatric\" href=\"UTD.htm?7/48/7946?source=see_link\">",
"     see \"Ibuprofen: Pediatric drug information\"",
"    </a>",
"    )",
"   </p>",
"   <div class=\"list ubnlist drugH1Div drugBrandNames\" id=\"F181456\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Brand Names: U.S.",
"    </span>",
"    <ul>",
"     <li>",
"      Addaprin [OTC];",
"     </li>",
