"    <li class=\"plainItem\">",
"     <a class=\"outlineLink\" href=\"#H10929205\">",
"      ELEMENTS OF THE GENERAL PHYSICAL EXAMINATION RELEVANT TO CHILD NEUROLOGY",
"     </a>",
