var title_f14_17_14621="Differential diagnosis of ALS";
var content_f14_17_14621=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEURO%2F64932&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEURO%2F64932&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Differential diagnosis of amyotrophic lateral sclerosis",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Disease",
"       </td>",
"       <td class=\"subtitle1\">",
"        Distinguishing features",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Multifocal motor neuropathy",
"       </td>",
"       <td>",
"        Multifocal nerve conduction block, very high GM1 ganglioside antibody titers",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cervical spondylosis or extramedullary tumor with compressive radiculopathy and myelopathy",
"       </td>",
"       <td>",
"        Sensory symptoms and signs, Lhermitte's symptom, LMN signs at level(s) of compression and UMN signs in legs, sphincter dysfunction, MRI of spine shows significant cord compression with intrinsic spinal cord signal abnormality",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Benign fasciculations",
"       </td>",
"       <td>",
"        No weakness or atrophy, no electromyographic abnormality of motor unit morphology",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Inclusion body myositis",
"       </td>",
"       <td>",
"        Disproportionate finger flexor weakness, no UMN signs, slow progression, diagnosis requires muscle biopsy, electromyography usually with myopathic features",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Primary lateral sclerosis",
"       </td>",
"       <td>",
"        A clinical variant of ALS: Spastic paraparesis, often with pseudobulbar palsy, prominent spasticity and hyperreflexia, no LMN signs",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Progressive bulbar palsy",
"       </td>",
"       <td>",
"        A clinical variant of ALS: Bulbar involvement predominates, pronounced dysarthria and dysphagia, limb musculature mostly spared",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Progressive muscular atrophy",
"       </td>",
"       <td>",
"        A clinical variant of ALS: Muscle weakness and atrophy with no UMN signs",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Myasthenia gravis",
"       </td>",
"       <td>",
"        Diplopia, ptosis, ocular dysmotility, weakness improved by acetylcholinesterase inhibitors, no UMN or LMN features",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Monomelic (benign focal) amyotrophy",
"       </td>",
"       <td>",
"        Onset usually in youth, slow and self limited course, no UMN features",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hereditary spinal muscular atrophy",
"       </td>",
"       <td>",
"        Symmetric, slow course, no UMN signs, usually diagnostic changes detected in the survival motor neuron 1 gene (SMN1)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hereditary spastic paraplegia",
"       </td>",
"       <td>",
"        Slowly progressive lower extremity spastic UMN weakness, minimal or no LMN symptoms and/or signs, sphincter dysfunction, sensory symptoms and signs, HSP gene positive if available",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Post-polio progressive muscular atrophy",
"       </td>",
"       <td>",
"        Slow course, no UMN signs",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Kennedy syndrome (bulbospinal muscular atrophy)",
"       </td>",
"       <td>",
"        X-linked recessive disorder, slow progression, expansion of a CAG trinucleotide repeat (&gt;35 CAGs) in the androgen receptor gene",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Late-onset Tay-Sachs disease (GM2 gangliosidosis)",
"       </td>",
"       <td>",
"        Late adolescent and early adult onset, progressive atrophic paralysis, hexosaminidase A deficiency",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Motor neuron syndromes with lymphoproliferative disorders",
"       </td>",
"       <td>",
"        Lymphoma (Hodgkin or non-Hodgkin), multiple myeloma, chronic lymphocytic leukemia, Waldenstrom's macroglobulinemia; some have paraproteinemia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Motor neuron syndromes in lung, breast, and other cancers",
"       </td>",
"       <td>",
"        May improve on treatment of the tumor, may be paraneoplastic or coincidental",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Radiation brainstem injury/radiation myelopathy",
"       </td>",
"       <td>",
"        History of radiation therapy for cancer, location of injury within the radiation ports, delay of months to a few years from treatment, LMN symptoms and signs at the level of the injury, possible UMN symptoms and signs below the injury, possible sensory symptoms and signs below the level of the injury (eg, Lhermitte's symptom), self limited: does not progress to a diffuse LMN/UMN disorder",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Thyrotoxic myopathy with fasciculations",
"       </td>",
"       <td>",
"        Overt or covert hyperthyroidism",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Intraspinal tumors and other lesions",
"       </td>",
"       <td>",
"        Imaging studies show syringomyelia, syringobulbia, or intraspinal tumors",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     LMN: lower motor neuron; UMN: upper motor neuron.",
"    </div>",
"    <div class=\"reference\">",
"     Modified from: Layzer RB. Chapter 415. Hereditary and acquired intrinsic motor neuron diseases. In: Bennett and Plum (Eds), Cecil Textbook of Medicine, W.B. Saunders, Philadelphia 1999.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
