"   <div class=\"lgnd\">",
"    Bilateral planar xanthomas in the palms of a 35-year-old woman with primary biliary cirrhosis. Xanthomas started in the creases and expanded. At the time that the xanthomas began to form, the serum bilriubin level was 18.6 mg/dL and serum cholesterol concentration was 970 mg/dL (25.2 mmol/l).",
